      content: >-
        Правила Щиткьюрити:

        1) Все виновны, даже если было доказано что невиновны.

        2) Всегда арестовывай падшего врага, чтобы он был усмирен после смерти.

        3) Если ты не уверен с кем ты ведёшь дело — с предателем или нет, то казни его.

        4) Клоун — это груша для битья. Он был создан для того, чтобы его бить без причины.

        5) Только через смерть правосудие восторжествует.

        6) Не нужно использовать камеры. Исключение: если только посмотреть на SEX.

        7) Радиотрёп для слабаков! Настоящий офицер может почувствовать преступления в действии и интуитивно.

        8) Неважно, есть ли в камере разгерметизация! Подонок должен отсидеть свой срок!

        9) Если киборг отказывается избивать преступника до смерти, то это значит, что он должен быть уничтожен за нарушение его законов.

        10) Если киборг всё таки избил преступника до смерти, то это значит, что он должен быть уничтожен за то, что забрал у тебя удовольствие от избиения преступников.

        11) Если у кого-то есть доступ, которого у тебя нет, то это означает, что они украли эту карточку! Ты должен конфисковать её для собственной миссии правосудия.

        12) Приказы Капитана и Главы службы безопасности это просто рекомендации, ты единственный истинный судья.

        13) Всегда болтируй и заваривай воздушные шлюзы отбытия. Это остановит любого преступного подонка от побега со станции.

        14) Если ты находишь инженера в изолированных перчатках, то оглуши его и арестуй. ОТКУДА ОН ИХ УКРАЛ!?

        15) Лучший способ разрешить драку: оглушить одну сторону и дать другой стороне убить своего оппонента. После этого повязать победителя.

        16) Преступники не едят, так что забирай у них еду, пока не растолстеешь.

        17) Раздевай заключённых и никогда не возвращай им их имущество, особенно если у них срок меньше двух минут.

        18) Капитан коварный и эгоистичный подонок более низкого ранга, чем ты и глава Щиткьюрити. Задержи или казни его как только найдешь доказательство. Если он попытается арестовать тебя или твоего Босса, то отправь в космос голышом.

        19) Убейте всех феленидов за их расовую неполноценность.

        20) Будь активным — арестовывай преступников до того, как они совершат преступление.
